import React from 'react';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';

//Custom Imports 
import Order from './data';

//Retrieve Data from DB
const rows = [
    Order('Atria'),
    Order('Callisto'),
    Order('Dione'),
    Order('Ganymede'),
    Order('Hangouts Call'),
    Order('Luna'),
    Order('Phobos'),
    Order('Pyxis'),
    Order('Sedna'),
    Order('Titania'),
    Order('Triton'),
    Order('Umbriel'),
    
];

const options = [
    'None',
    'Atria',
    'Callisto',
    'Dione',
    'Ganymede',
    'Hangouts Call',
    'Luna',
    'Oberon',
    'Phobos',
    'Pyxis',
    'Sedna',
    'Titania',
    'Triton',
    'Umbriel',
];

const ITEM_HEIGHT = 48;

export default function NotifMenu({ notifAnchor, handleClose, isNotifOpen }) {
    return (
        <div>
            <Menu
                id="long-menu"
                anchorEl={notifAnchor}
                keepMounted
                open={isNotifOpen}
                onClose={handleClose}
                PaperProps={{
                    style: {
                        maxHeight: ITEM_HEIGHT * 4.5,
                        width: '20ch',
                    },
                }}
            >
                {rows.map((row) => (
                    <MenuItem key={row.order} onClick={handleClose}>
                        {row.order}
                    </MenuItem>
                ))}
            </Menu>
        </div>
    );
}
